int main() {
    int n, k;
    scanf("%d %d", &n, &k);

    // If there are more pairs of vertices with shortest distance 2 than possible
    if (k > n * (n - 1) / 2) {
        printf("-1\n");
        return 0;
    }

    // Create an adjacency matrix for the graph
    int** graph = (int**)malloc(n * sizeof(int*));
    for (int i = 0; i < n; i++) {
        graph[i] = (int*)malloc(n * sizeof(int));
        for (int j = 0; j < n; j++) {
            graph[i][j] = 0;
        }
    }

    // Construct a graph with the desired properties
    int m = n - 1; // Minimum number of edges required for a connected graph
    for (int i = 1; i < n; i++) {
        graph[i - 1][i] = 1;
        graph[i][i - 1] = 1;
    }

    // Add extra edges to create pairs of vertices with shortest distance 2
    int addedEdges = 0;
    for (int i = 0; i < n - 2; i++) {
        for (int j = i + 2; j < n; j++) {
            if (addedEdges == k) {
                break;
            }
            graph[i][j] = 1;
            graph[j][i] = 1;
            addedEdges++;
            m++;
        }
    }

    // Check if the constructed graph satisfies the conditions
    if (isConnected(graph, n) && countPairsDistance2(graph, n) == k) {
        // Print the graph
        printf("%d\n", m);
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                if (graph[i][j] == 1) {
                    printf("%d %d\n", i + 1, j + 1);
                }
            }
        }
    } else {
        printf("-1\n");
    }

    // Free the allocated memory
    for (int i = 0; i < n; i++) {
        free(graph[i]);
    }
    free(graph);

    return 0;
}
